import user_history from "../../data/history/user_history";
import phone_history from "../../data/history/phone_history.json"
import * as style from "../../css/light/focusedList"

export default function ProfileHistory(props) {
  return (
    <div style={{position: "absolute", top: "500px"}}>
      <div style={style.focusedTitle}>Profile History</div>
      <div style={{...style.focusedDivider, margin: "3px 0px 6px 8px", width: "32.1vw"}}/>
      <div style={style.focusedHistoryContainer}></div>
    </div>
  )
}
